import { Component } from '@angular/core';

@Component({
  selector: 'app-filmes',
  templateUrl: './filmes.component.html',
  styleUrls: ['./filmes.component.scss']
})
export class FilmesComponent {

  public filmes: any = [
  {
    nome: 'Senhor dos anéis',
    horario: '19/11/2022 15:30:00'
  },
  {
    nome: 'Star Wars',
    horario: '19/11/2022 15:30:00'
  },
  {
    nome: 'Star Trek',
    horario: '19/11/2022 15:30:00'
  }
]
}
<h1>Filmes</h1>

<p><b>Nome:</b> {{filmes[0].nome}}</p>
<p><b>Horario:</b> {{filmes[0].horario}}</p>

